@SupraDarky
I was wondering if you'd ever put this song up. So many childhood memories come back when I hear this. 
This was the first game I ever played, and I loved it. My brothers use to take me to the Arcade to play it there before they bought it for SNES. Jago and Glacius were my mains, and I still remember all the combos to this day. Thanks Supra. I think its time I call my brothers for a "reunion" now. :D
